column8:
■縦持ちしやすいトップハンドル付き。<br>
■持運び・収納時の安全性に配慮した構造。重量があり、刃も付いたアイスドリルを安全に持運びできる3面PEハードボード内蔵。トップ部も縫い込みPEハードボードで保護。<br>
■バッグ本体は寒冷地でも硬くなりにくいポリエステル素材。<br>
■バッグ底部は水や汚れに強いPVCターポリン素材。<br><br>

